import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <header className='navbar bg-dark'>
        <div className='logo'><a className='navbar-brand'>СамГТУ</a></div>
        <div className='dropdown'>
          <button className='btn btn-dark dropdown-toggle'>2022 год</button>
        </div>
        <div className='text'><span className='text__color'>Аналитика</span></div>
      </header>
    );
}

export default Header;
